import "./Nav.css";

const Nav = ({ outModal, addSpot }) => {
  const [open, setOpen] = useState(true);

  const cancelButtonRef = useRef(null);
  return (
    <div className="nav-container">
      <h1>Kite</h1>
      <div className="nav-right">
        <Example />
      </div>
    </div>
  );
};

export default Nav;
